import React, { useState } from "react";
import {
  PageContainer,
  Overlay,
  Title,
  Subtitle,
  Demo,
  theme,
} from "./index_style.js";

function Home() {
  return (
    <PageContainer>
      <Overlay />
      <Title>MARview</Title>
      <Subtitle>The Future of Maritime Navigation</Subtitle>
      <Demo theme="blue">Schedule a Demo</Demo>
    </PageContainer>
  );
}

export default Home;
